@ap_mess @RepArrington Project Veritas caught the vehicle filled with ballots [for Omar] in Minn.

Project Veritas caught the ballot harvesting in Texas.

Video evidence was shown of Biden supporters blocking poll watchers in Philadelphia.

@prageru It’s been a long-running joke in California that we’d discover life on other planets before Orange County ever turned blue.
Then in 2018 ballot harvesting did it.
And the special election in Katie Hill’s district, after her ouster, swung it solidly back to the Republican.
